package cn.bjjoy.bms.setting.persist.model;import java.io.Serializable;import cn.afterturn.easypoi.excel.annotation.Excel;/** * 类描述   :  * 创建人	：system * 创建时间 ：2018-09-13 23:02:18 * @version 1.0 */public class Datacard implements Serializable {	/**  */	private String id;	/**  */	private String addPer;	/**  */	private String addTime;	/**  */	@Excel(name = "单位名称", orderNum = "0")	private String unitName;	/**  */	@Excel(name = "设备名称", orderNum = "1")	private String equipName;	/**  */	@Excel(name = "手机卡号", orderNum = "2")	private String mobilePhone;		@Excel(name = "资费标准", replace={"5元包月_1","10元包月_2","20元包月_3","30元包月_4","50元包月_5","100元包月_6","200元包月_7","500元包月_8","1000元包月_9"} , orderNum = "3")	private String costStandard;	/**  */	@Excel(name = "充值金额", orderNum = "4")	private String amount;	/**  */	@Excel(name = "充值时间", orderNum = "5")	private String refillTime;	/**  */	@Excel(name = "当前余额", orderNum = "6")	private String balance;	/**  */	@Excel(name = "当前状态", replace = {"正常_1", "异常_2"}, orderNum = "7")	private String currentState;	public Datacard(String unitName, String equipName, String mobilePhone,			String amount, String refillTime, String balance,			String currentState, String costStandard) {		super();		this.unitName = unitName;		this.equipName = equipName;		this.mobilePhone = mobilePhone;		this.amount = amount;		this.refillTime = refillTime;		this.balance = balance;		this.currentState = currentState;		this.costStandard = costStandard;	}		 	/** 	 * 获取 主键	 */		public String getId() {		return id;	}	/** 	 * 设置 主键	 */	public void setId(String id) {		this.id = id;	}	 	/** 	 * 获取 	 */		public String getUnitName() {		return unitName;	}	/** 	 * 设置 	 */	public void setUnitName(String unitName) {		this.unitName = unitName;	}	 	/** 	 * 获取 	 */		public String getEquipName() {		return equipName;	}	/** 	 * 设置 	 */	public void setEquipName(String equipName) {		this.equipName = equipName;	}	 	/** 	 * 获取 	 */		public String getMobilePhone() {		return mobilePhone;	}	/** 	 * 设置 	 */	public void setMobilePhone(String mobilePhone) {		this.mobilePhone = mobilePhone;	}	 	/** 	 * 获取 	 */		public String getAmount() {		return amount;	}	/** 	 * 设置 	 */	public void setAmount(String amount) {		this.amount = amount;	}	 	/** 	 * 获取 	 */		public String getRefillTime() {		return refillTime;	}	/** 	 * 设置 	 */	public void setRefillTime(String refillTime) {		this.refillTime = refillTime;	}	 	/** 	 * 获取 	 */		public String getBalance() {		return balance;	}	/** 	 * 设置 	 */	public void setBalance(String balance) {		this.balance = balance;	}	 	/** 	 * 获取 	 */		public String getCurrentState() {		return currentState;	}	/** 	 * 设置 	 */	public void setCurrentState(String currentState) {		this.currentState = currentState;	}	 	/** 	 * 获取 	 */		public String getAddPer() {		return addPer;	}	/** 	 * 设置 	 */	public void setAddPer(String addPer) {		this.addPer = addPer;	}	 	/** 	 * 获取 	 */		public String getAddTime() {		return addTime;	}	/** 	 * 设置 	 */	public void setAddTime(String addTime) {		this.addTime = addTime;	}	 	/** 	 * 获取 	 */		public String getCostStandard() {		return costStandard;	}	/** 	 * 设置 	 */	public void setCostStandard(String costStandard) {		this.costStandard = costStandard;	}}